import React, {useState, useEffect} from 'react';
import '../App.css';

function Events() {

  useEffect(() => {
    fetchEvents();
  }, []);

  const [events, setEvents] = useState([]);

  const fetchEvents = async () => {
    const data = await fetch(
      'http://localhost:3000/standford-events-rss.json'
    );
    const events = await data.json();
    console.log(events.channel.item);
    setEvents(events.channel.item);

  };

  const items = []

  for (const [index, value] of events.channel.item()) {
    items.push(<h1 key={index}>{value}</h1>)
  }


  return (
    <div className="App">
      <h1>{items}</h1>
    </div>
  );
}

export default Events;
